def get_gcd(l):
    """
    Given an array of integers, find the greatest common divisor of the elements.
    For example:
    get_gcd([2, 4, 6, 8]) == 2
    get_gcd([3, 6, 9, 12]) == 3
    get_gcd([5, 10, 15, 20]) == 5
    """
    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    if not l:
        return 0

    result = l[0]
    for i in range(1, len(l)):
        result = gcd(result, l[i])
    return result
```

