def magic_square_test(my_matrix):
    """
    Calculates the magic square of a given matrix.

    Args:
        my_matrix: A list of lists representing the square matrix.

    Returns:
        A dictionary containing the magic constant and the magic square.
        Returns None if the input is not a square matrix.
    """
    n = len(my_matrix)

    # Check if it's a square matrix
    for row in my_matrix:
        if len(row) != n:
            print("Error: Input must be a square matrix.")
            return None

    magic_constant = int(sum(my_matrix[0]))

    magic_square = [[0 for _ in range(n)] for _ in range(n)]

    for i in range(n):
        for j in range(n):
            if i == j:
                magic_square[i][j] = magic_constant
            else:
                magic_square[i][j] = int(my_matrix[i][j])

    return {"magic_constant": magic_constant, "magic_square": magic_square}
```

