def is_Sum_Of_Powers_Of_Two(n) -> bool:
    """
    Given a non-negative integer n, return True if it can be represented as sum of non-zero powers of 2, otherwise return False.
    For example:
    is_Sum_Of_Powers_Of_Two(0) == True
    is_Sum_Of_Powers_Of_Two(1) == False
    is_Sum_Of_Powers_Of_Two(2) == True
    is_Sum_Of_Powers_Of_Two(3) == False
    """
    if n == 0:
        return True
    while n > 0:
        if n % 2 == 0:
            n //= 2
        else:
            if n > 1:
                return False
            else:
                return True
    return False
```

