def even_bit_toggle_number(n):
    """Toggles all even bits of a given number."""
    while n > 0:
        count = 0
        temp = n
        while temp > 0:
            count += temp & 1
            temp >>= 1
        for i in range(count):
            n ^= (1 << i)
    return n
```

