def answer(L,R):
    """
    Finds two distinct numbers such that their lcm lies within the given range.

    Args:
        L: The lower bound of the range.
        R: The upper bound of the range.

    Returns:
        A tuple containing the two distinct numbers if found, otherwise None.
    """
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return (a * b) // gcd(a, b)

    for i in range(1, R // 2 + 1):
        if L <= i <= R and lcm(i, R - i) == R:
            return (i, R - i)
    return None
```

