    def solve(index, current_sum, last_bit):
        if index == 2 * n:
            return 1 if current_sum == 0 else 0

        if (index, current_sum, last_bit) in dp:
            return dp[(index, current_sum, last_bit)]

        count = 0
        for bit in range(support_bits(n, current_sum, last_bit)):
            count += solve(index + 1, current_sum + bit, bit)

        dp[(index, current_sum, last_bit)] = count
        return count

    def support_bits(n, current_sum, last_bit):
        if n == 0:
            return 1 if current_sum == 0 else 0

        if current_sum == 0:
            return 1

        if last_bit == 0:
            return support_bits(n - 1, current_sum, 1)

        return support_bits(n - 1, current_sum + last_bit, 1)

    return solve(0, 0, 0)
