            count += solve(index + 1, current_sum + bit, bit)

        dp[(index, current_sum, last_bit)] = count
        return count

    def support_bits(n, current_sum, last_bit):
        count = 0
        for i in range(n):
            if current_sum + i == current_sum + last_bit:
                count += 1
        return count

    return solve(0, 0, 0)
