def get_perrin(n):
    """
    Finds the n'th perrin number using recursion.

    The perrin number is defined as the perrin number of the first n integers.
    The perrin number of the first n integers is the perrin number of the first n integers.

    Args:
        n: The index of the perrin number to find.

    Returns:
        The n'th perrin number.
    """
    if n <= 0:
        return 0
    elif n == 1:
        return 1
    elif n == 2:
        return 2
    else:
        return get_perrin(n - 1) + get_perrin(n - 2)
```

