def get_perrin(n):
    """
    Finds the n'th perrin number using recursion.

    The perrin number is defined as the sequence of numbers where each number
    is the perrin number of the previous number.

    Args:
        n: The index of the perrin number to find.

    Returns:
        The n'th perrin number.
    """
    if n == 1:
        return 4
    elif n == 2:
        return 4
    elif n == 3:
        return 7
    elif n == 4:
        return 10
    elif n == 5:
        return 16
    elif n == 6:
        return 27
    elif n == 7:
        return 40
    elif n == 8:
        return 57
    elif n == 9:
        return 74
    elif n == 10:
        return 100
    else:
        return get_perrin(n - 1) + get_perrin(n - 2) - get_perrin(n - 3)
