def count_Occurrence(tup, lst):
    """
    Counts the number of occurrences of all elements of list lst in tuple tup.

    Args:
        tup (list): The input tuple.
        lst (list): The list of elements to count occurrences of.

    Returns:
        int: The number of occurrences of each element in lst in tup.
    """
    counts = {}
    for element in lst:
        counts[element] = 0
    for element in tup:
        if element in counts:
            counts[element] += 1
    return dict(counts)
